;; gorilla-repl.fileformat = 1

;; **
;;; # Polynomial Interpolation, the Runge Phenomenon, Chebycheff Roots
;; **

;; @@
(use 'gorilla-repl.core)
(use 'gorilla-plot.core)
(use 'incanter.interpolation)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
