;; **
;;; Let the Runge function be defined as $$f(x) = \frac{1}{1 + x^2}$$ and @@x_j = -5 + jh@@ for @@j = 0, 1, \dots, n@@ and @@h = \frac{10}{n}@@.
;; **

;; @@
(defn runge-fn [x]
  (/ 1 
     (+ 1 (Math/pow x 2))))

(defn domain [n]
  (let [j (range (inc n))
        h (/ 10 n)]
    (map #(+ -5 (* % h)) j)))
