;; **
;;; Define the interpolant as $$p(x) = \sum_{i=0}^n \alpha_i x^i$$ and create an interpolation based off the equidistant points we've calculated. Incanter happens to include a robust interpolation library which has this form of polynomial interpolation built in.
;; **

;; @@
(def runge-interpolation (interpolate points :polynomial
                                      :basis :polynomial))
