;; @@
(compose
 (plot runge-fn [-5 5] :color "black" :plot-range [[-5 5] [0 1.5]])
 (plot runge-interpolation [-5 5]
        :color "#ff3333" :plot-points 1000)
 (list-plot points :symbol-size 20))

