;; **
;;; This is called the Runge phenomenon, and it shows that with polynomial interpolation adding more interpolation points (yielding a higher degree polynomial) will not necessarily give us more accurate results.
;; **

;; **
;;; ## More judicious interpolation
;;; 
;;; We can instead calculate our points at the root of the Chebycheff polynomials such that $$x_i = 5 \cos \frac{i \pi}{n},$$ for @@i=0,1,\dots,n@@
;; **

;; @@
(defn chebycheff [n x]
  (* 5 (Math/cos (/ (* x Math/PI)
                            n))))

(defn chebycheff-domain [n]
  (let [i (range (inc n))]
    (map (partial chebycheff n)
         i)))
